import React from "react";
import Card from './Card.js';

const CardList = ({ robots }) => {
    const CardComponent = robots.map((user,i) => {
        return <Card id={user[i].id} name={user[i].name} email={user[i].email}/>
    })
    return (
        {CardComponent}
    )
}

export default CardList
